import React, {Fragment} from "react";
import {BrowserRouter as Router, Route} from "react-router-dom";
import Title from "./Title.js";
import Content from "./Content";

function Home() {
  const title = Title("MusMe","Welcome to MusMe: the Library to Find the Soundtrack for You");
  const content = Content(
  <p>MusMe is an <b>affordable, subscription-based, royalty-free music library</b> powered by TwinsMusic Enterprises, based in Pelham, New York, USA. The library features original music, sound bites, ringtones, and sounds effects fit for hundreds of moods and settings. MusMe sets itself apart from other music libraries because all music in the library is acoustic original music. Each month, the MusMe team updates the library with refreshing new music and sounds so users will never run out of new content. 

  </p>
  );
  return (
    <div> 
      {title}
      {content}
    </div>



  );
}

export default Home;
